import React from "react";

const Hashrate = ({ hashrate }) => {
	return (
		<div>
			{hashrate.map((hashrate) => (
            <div class="column is-2">
                <div class="column">
                    <div>
                        Network
                    </div>
                    <div class="coinStatsContent">
                        {(hashrate.coinbase / 32).toFixed(2)} Kgps
                    </div>
                </div>
                <div class="column">
                    <div>
                        Difficulty
                    </div>
                    <div class="coinStatsContent">
                        {Intl.NumberFormat().format(hashrate.blk_no)}
                    </div>
                </div>
            </div>
            ))}
		</div>
	)
};

export default Hashrate;
